    <script type="text/javascript">
      $(document).ready(function(){
        $('#no-auto-fill').disableAutoFill({
          passwordField: '.password',
          callback: function() {
            return checkForm();
          }
        });

        function checkForm() {
          form = document.getElementById('no-auto-fill');
          if (form.password.value == '') {
            alert('Cannot leave Password field blank.');
            form.password.focus();
            return false;
          }
          if (form.username.value == '') {
            alert('Cannot leave User Id field blank.');
            form.username.focus();
            return false;
          }
          return true;
        }
      });
    </script>
